import React from 'react';

import { Jumbotron, OverlayTrigger, Popover } from 'react-bootstrap';
import { Grid, Image, Header, Message, Button, Icon } from 'semantic-ui-react';

import Footer from '../Footer';

import Flash from "react-reveal/Flash";

import "../css/Services.css";
import '../../App.css';


const Services = () => {
  return (
  	<>
  		<Head />
  		<ServiceSection />
  		<Footer />
  	</>
  );
};

const popover = (
  <Popover id="popover-basic">
    <Popover.Title as="h3">No FEAR</Popover.Title>
    <Popover.Content>
      We accept any challenge! Let us know what you need, and watch it get done!
    </Popover.Content>
  </Popover>
);

const Head = () => {
	return (
		<>
			<div className="contentContainer">
				<Jumbotron>
	  				<Header as='h1' icon textAlign='center' size='huge'>
						<Icon color="black" name='handshake outline' circular/>
						<Header.Content><h1 style={{ color: "#FFFFFF" }}><strong>Our Services</strong></h1></Header.Content>
					</Header>

					<Message size="big">
						<p>
				    		We handle each project with great care and treat customer with the time and attention theu deserve. If the service you requested in not listed on this page, you can <span className="flashCont"><Flash><OverlayTrigger trigger="hover" placement="right" overlay={popover}><span className="contactLink">contact</span></OverlayTrigger></Flash></span> us to maek ararngements.
						</p>
					</Message>

	    			<Button primary animated>
						<Button.Content visible>Make it Happen</Button.Content>
						<Button.Content hidden>Go!</Button.Content>
					</Button>
				</Jumbotron>
			</div>
		</>
	)
}

const ServiceSection = () => {
	return (
		<>
			<Grid centered>

			</Grid>
		</>
	)
}

export default Services;
